// productService.js


const API_URL = 'https://dummyjson.com/products';

const getProducts = async () => {
  try {
    const response = await fetch(API_URL);
    return response.data;
  } catch (error) {
    console.error('Error fetching products:', error);
    throw error;
  }
};

export { getProducts };
